      price: "$2,742",
      type: "Apartment",
    },
]

const ManagerHouse = () => {
    const authCtx = useContext(AuthContext)
    
    const [houses, setHouses] = useState([])
    
    useEffect(() => {
        getOwnedHouseApi(authCtx.userId, authCtx.token)
        .then((data) => {
            console.log(data)
        })
        .catch((err) => {
            alert(err.message);
        });
    })
  
    return (
        <section>
            <Back name='House' title='House Grid - Our Houses' cover={img} path="/add-house" action="Add House"/>
            <section className={`${classes.recent} ${classes.padding}`}>
                <div className={classes.container}>
                    <div className={`${classes.grid3} ${classes.mtop}`}>
                        {Data.map((item, index) => <HouseCard item={item} index={index}/>)}
                    </div>
                </div>
            </section>
        </section>
    )
}

export default ManagerHouse;
